import React from "react";
import Layout from "../components/Layout";

const propTypes = {};

const defaultProps = {};

export default function index() {
  return (
    <Layout>
      <section className="flex">
        <aside className="dib vh-100 title">Agenda</aside>
        <div className="bg-red vh-100 dib">
          <div className="grow">
            <div>agenda item</div>
            <div>+ add item</div>
          </div>
        </div>
      </section>
      <style global>
        {`

        .grow {
            flex-grow: 1
        }

        .title{
            writing-mode: vertical-rl;
            transform: rotate(180deg);
            text-align: center;
            font-size: 4rem;
            text-transform: uppercase;
            padding: 20px
        }
        .w-100{
            width: 100%
        }
        .dib{
            display: inline-block
        }
        .vh-100{
            height: 100vh
        }
        .bg-blue {
            background-color: blue
        }
        .bg-red{
            background-color: red
        }
        .col {
            flex-direction: column
        }
        .flex {
            display flex
        }
        .grid {
            display: grid
        }

      `}
      </style>
    </Layout>
  );
}

index.propTypes = propTypes;
index.defaultProps = defaultProps;
